import Player from "./Player";

export default function Cell({ cellNumber, snacks, hasPlayer }) {
  const getSnake = () => {
    return snacks.find((snake) => {
      return snake.startPos === cellNumber || snake.endPos === cellNumber
    })
  }

  return (
    <div className="cell">
      {hasPlayer && <Player />}
      <Snake snake={getSnake} />
      <div>{cellNumber}</div>
    </div>
  );
}
